import {
  LayerGroup,
  LayersControl,
  Marker,
  Tooltip,
  TileLayer,
  Popup,
} from "react-leaflet";
import L from 'leaflet';
import green from '../../assets/images/green.png';
import shadow from '../../assets/images/shadow.png';


const Map = ({ zoom, coords }) => {

  let greenIcon = L.icon({
    iconUrl: {green},
    shadowUrl: {shadow},

    iconSize: [38, 95],
    shadowSize: [50, 64],
    iconAnchor: [22, 94],
    shadowAnchor: [4, 62],
    popupAnchor: [-3, -76]
  });

  return (
    <LayersControl position="topright">
      <LayersControl.BaseLayer checked name="Basemap">
        <TileLayer url="tiles/{z}/{x}/{y}.png" noWrap={true} />
      </LayersControl.BaseLayer>
      <Marker position={[-98, 65]} icon={greenIcon}>
        <Popup>
          Rockholm
        </Popup>
      </Marker>
    </LayersControl>
  );
};
export default Map;
